import Nav from 'react-bootstrap/Nav';
import Button from 'react-bootstrap/Button';

import './App.css'

function Navi() {
  return (
    <Nav className='Nav' defaultActiveKey="/home" as="ul">
      <Nav.Item >
        <Nav.Link className='Link1' href="/home">      <Button variant="success">home</Button>
</Nav.Link>
      </Nav.Item>
    </Nav>
  );
}

export default Navi;
